import React from "react";
import { Link } from "react-router-dom";

export default function Welcome(props) {
    
  return (
    <>
    <div className="container" style={{display:"flex"}}>
      <button type="button" className="btn btn-outline-success" onClick={props.handleonclicklogin}> Login/signup for farmers</button>
      <button type="button" className="btn btn-outline-success"onClick={props.handleonclicklogin}>Login/signup for user</button>
    </div>
    </>
  )
}
